import React from "react";
import './Login.css';

function Login(){
    const formData = () =>{
        console.log("hi");
    }
    const onSubmit = () =>{
        console.log("hi");
    }
    return (
        <>
          <h1 className="login"> Welcome to MedApp</h1>
          <div className="container form_align">
              <h4 className="form_head">Sign in to special offer, health tips and more</h4>
              <form onSubmit={onSubmit}>
                   <div className="row">
                        <div className="col-sm-4"></div>
                        <div className="form-group col-sm-4">
                           <input type="email" className="form-control" id="email" placeholder="Enter email" name="email" onChange={formData} />
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-sm-4"></div>
                        <div className="form-group col-sm-4">
                           <input type="password" className="form-control" id="pwd" placeholder="Enter password" name="pwd" onChange={formData} />
                        </div>
                    </div>
                    <button type="submit" className="btn btn-sm btn-default btn_login">Sign In</button> 
                </form>
               
            </div>
        </>
    );
}

export default Login;
